import { Avatar, TextField } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
        <div>     
           
             
              <TextField style={{marginLeft:'100px', width:'500px' }}
              
          id="filled-textarea"
          label="What's on your mind dawg?"
          placeholder="Placeholder"
          multiline
          variant="filled"
        > <Avatar style={{height:'60px',width:'60px'}} alt="Remy Sharp" src={nikklaus} /> </TextField>
        </div>
     );
}
 
export default Posts;
